INSERT INTO `_data` VALUES ('30', 'VỚI CHÚNG TÔI, CHẤT LƯỢNG, SỰ AN TOÀN VÀ TIẾN ĐỘ CÔNG TRÌNH LUÔN LÀ NHỮNG ƯU TIÊN HÀNG ĐẦU', 'WITH US, QUALITY, SAFETY AND PROGRESS ARE PRIORITY OF THE TOP', 'Hiện nay chung tôi đang tiến hành các công trình:\n+ Cty TNHH Tín Thảo.\n+ Công Ty Cổ Phần Thiên Lộc\n+ Nhà máy J.S (mở rộng)\n+ Công ty TNHH Hán Kiệt.\n+ ...', 'Currently we are carrying out the work:\n+ Tin Thao Co., ltd.\n+ Thien Loc Corporation\n+ Factory J.S (extended)\n+ Han Kiet Co., ltd\n+ ...', '/assets/nha-dat/img/bg2.jpg', '/assets/nha-dat/img/bg2.jpg', '<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51)\">Kh&aacute;ch h&agrave;ng chỉ cần cung cấp &yacute; tưởng sơ bộ, ch&uacute;ng t&ocirc;i sẽ hỗ trợ to&agrave;n bộ c&aacute;c c&ocirc;ng việc c&ograve;n lại, từ thiết kế đến c&aacute;c bước chuẩn bị thủ tục xin ph&eacute;p x&acirc;y dựng, giấy ph&eacute;p PCCC, v.v. Sau đ&oacute; đến c&ocirc;ng t&aacute;c thi c&ocirc;ng, trang tr&iacute; nội thất v&agrave; ho&agrave;n c&ocirc;ng c&ocirc;ng tr&igrave;nh.</span>', 'Customers only need to provide preliminary ideas, we will support all of the remaining work, from design to preparation procedures for construction permits, licenses fire protection, etc. Then came the construction, interior decoration and completed work.', '2015-04-08 13:21:05', '2015-08-03 11:54:26', 'true', 'pri-event', null, 'CÁC CÔNG TRÌNH XÂY DỰNG', 'PROJECTS', '0', '2015-04-08 16:57:26', '2015-04-09 16:57:32', 'Thiết Kế - Trang Trí Nội Thất', 'Design - Interior Decoration');
INSERT INTO `_data` VALUES ('31', 'VỚI CHÚNG TÔI, CHẤT LƯỢNG, SỰ AN TOÀN VÀ TIẾN ĐỘ CÔNG TRÌNH LUÔN LÀ NHỮNG ƯU TIÊN HÀNG ĐẦU', 'WITH US, QUALITY, SAFETY AND PROGRESS ARE PRIORITY OF THE TOP', 'Hiện nay chung tôi đang tiến hành các công trình:\n+ Công Ty TNHH GDI TEXTILE\n+ Công Ty TNHH VIMA LA\n+ Nhà máy công ty TNHH TOÀN VIỆT\n', 'Currently we are carrying out the work:\n+ Tin Thao Co., ltd.\n+ Thien Loc Corporation\n+ Viet Nam J.S Plastic Packaging Co.,Ltd (extension)\n+ Han Kiet Co., ltd\n+ ...', '/assets/nha-dat/img/bg2.jpg', '/assets/nha-dat/img/bg2.jpg', '<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51)\">Kh&aacute;ch h&agrave;ng chỉ cần cung cấp &yacute; tưởng sơ bộ, ch&uacute;ng t&ocirc;i sẽ hỗ trợ to&agrave;n bộ c&aacute;c c&ocirc;ng việc c&ograve;n lại, từ thiết kế đến c&aacute;c bước chuẩn bị thủ tục xin ph&eacute;p x&acirc;y dựng, giấy ph&eacute;p PCCC, v.v. Sau đ&oacute; đến c&ocirc;ng t&aacute;c thi c&ocirc;ng, trang tr&iacute; nội thất v&agrave; ho&agrave;n c&ocirc;ng c&ocirc;ng tr&igrave;nh.</span>', '<div>Customers only need to provide preliminary ideas, we will support all of the remaining work, from design to preparation procedures for construction permits, licenses fire protection, etc. Then came the construction, interior decoration and completed work.</div>\n', '2015-04-08 13:21:48', '2018-11-15 11:35:09', 'true', 'pri-event', null, 'PROJECTS', 'CONSTRUCTION WORKS', '0', '2015-04-07 16:57:11', '2015-04-09 16:57:19', 'Khách Hàng Quan Tâm', 'Customer Concern');
INSERT INTO `_data` VALUES ('32', 'VỚI CHÚNG TÔI, CHẤT LƯỢNG, SỰ AN TOÀN VÀ TIẾN ĐỘ CÔNG TRÌNH LUÔN LÀ NHỮNG ƯU TIÊN HÀNG ĐẦU', 'WITH US, QUALITY, SAFETY AND PROGRESS ARE PRIORITY OF THE TOP', 'Hiện nay chung tôi đang tiến hành các công trình:\n+ Cty TNHH Tín Thảo.\n+ Công Ty Cổ Phần Thiên Lộc\n+ Công ty cổ phần Bao Bì Việt\n+ Công ty TNHH Hán Kiệt.\n+ ...', 'Currently we are carrying out the works:\n+ Tin Thao Co., ltd.\n+ Thien Loc Corporation\n+ Bao Bi Viet Joint Stock Co.\n+ Han Kiet Co., ltd\n+ ...', '/assets/nha-dat/img/bg2.jpg', '/assets/nha-dat/img/bg2.jpg', 'Kh&aacute;ch h&agrave;ng chỉ cần cung cấp &yacute; tưởng sơ bộ, ch&uacute;ng t&ocirc;i sẽ hỗ trợ to&agrave;n bộ c&aacute;c c&ocirc;ng việc c&ograve;n lại, từ thiết kế đến c&aacute;c bước chuẩn bị thủ tục xin ph&eacute;p x&acirc;y dựng, giấy ph&eacute;p PCCC, v.v. Sau đ&oacute; đến c&ocirc;ng t&aacute;c thi c&ocirc;ng, trang tr&iacute; nội thất v&agrave; ho&agrave;n c&ocirc;ng c&ocirc;ng tr&igrave;nh.', '<div>Customer only needs to provide their comcept idea, we will support all the remaining works from design to prepare documents to submit for construction permission, anti-fire license,&hellip;Then execution, interior decoration and as built work.</div>\n', '2015-04-08 15:38:37', '2016-06-08 15:29:27', 'true', 'pri-event', null, 'CÁC CÔNG TRÌNH XÂY DỰNG', 'PROJECTS', '0', '2015-04-08 15:37:28', '2015-04-08 16:37:31', 'Công Trình Dự Án', 'Projects');
