INSERT INTO `site` VALUES ('1', 'Công trình dự án', 'VỚI CHÚNG TÔI TÍNH MẠNG CON NGƯỜI VÀ SỰ AN TOÀN TẤT CẢ.', 'Hiện nay chung tôi đang tiến hành các công trình:\r\n+ Cty TNHH Tín Thảo.\r\n+ Công Ty TNHH Count Vina.\r\n+ ...', 'THÔNG TIN LIÊN HỆ', '', '/data/image/color/1x1.jpg', '<p><span style=\"color:rgb(102, 102, 102); font-family:myriadproregular,sans-serif; font-size:13px\">Tuy tuổi đời c&ograve;n trẻ, nhưng ch&uacute;ng t&ocirc;i đ&atilde; trở th&agrave;nh đối t&aacute;c đ&aacute;ng tin cậy cho c&aacute;c c&ocirc;ng ty trong v&agrave; ngo&agrave;i nước lựa chọn l&agrave;m nh&agrave; thầu cho c&aacute;c c&ocirc;ng tr&igrave;nh của họ, với mức độ tin tưởng tuyệt đối. Ch&uacute;ng t&ocirc;i lu&ocirc;n ho&agrave;n th&agrave;nh tốt c&aacute;c c&ocirc;ng việc của m&igrave;nh, khi mỗi một c&ocirc;ng tr&igrave;nh được nhiệm thu đều l&agrave; một niềm vui khi những th&agrave;nh quả m&agrave; ch&uacute;ng t&ocirc;i đ&oacute;ng g&oacute;p đem lại sự h&agrave;i l&ograve;ng cho kh&aacute;c h&agrave;ng cũng như những người sử dụng c&aacute;c c&ocirc;ng tr&igrave;nh đ&oacute;. V&agrave; ch&uacute;ng t&ocirc;i lu&ocirc;n đặt tr&aacute;ch nhiệm v&agrave; sự an to&agrave;n l&ecirc;n h&agrave;ng đầu, bởi với ch&uacute;ng t&ocirc;i t&iacute;nh mạng con người lu&ocirc;n tr&aacute;ch nhiệm cao nhất mỗi khi bắt tay v&agrave;o khởi c&ocirc;ng cho một dự &aacute;n.</span></p>\n', '/assets/nha-dat/img/bg2.jpg', '2014-09-29 13:59:37', '2015-06-09 11:30:03', 'true', 'true', '');
